func maxOperations(s string) int {
    ones := 0
    tot := 0
    prevZero := true
    for i := 0; i < len(s); i++ {
        if s[i] == '1' {
            ones++
            prevZero = false
        }
        if s[i] == '0' && !prevZero {
            tot += ones
            prevZero = true
        }
    }
    return tot
}
